var title_f35_1_35867="Hemorrhagic cystitis drugs";
var content_f35_1_35867=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F66805&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F66805&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Chemotherapeutic drugs causing hemorrhagic cystitis",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Agents",
"       </td>",
"       <td class=\"subtitle1\">",
"        Effect",
"       </td>",
"       <td class=\"subtitle1\">",
"        Caveats",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Cyclophosphamide, Ifosfamide",
"       </td>",
"       <td>",
"        Hemorrhagic cystitis",
"       </td>",
"       <td>",
"        Uroprotection with mesna, saline and continuous bladder irrigation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Busulfan",
"       </td>",
"       <td>",
"        Hemorrhagic cystitis",
"       </td>",
"       <td>",
"        Seen with prolonged systemic therapy; long delay of onset",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Thiotepa",
"       </td>",
"       <td>",
"        Irritation and rarely hemorrhagic cystitis",
"       </td>",
"       <td>",
"        Intravesical",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Doxorubicin",
"       </td>",
"       <td>",
"        Reversible&nbsp;hemorrhagic cystitis in 20 to 30 percent",
"       </td>",
"       <td>",
"        Intravesical",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Mitomycin",
"       </td>",
"       <td>",
"        Cystitis in 15 percent",
"       </td>",
"       <td>",
"        Intravesical",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Fludarabine",
"       </td>",
"       <td>",
"        Rare hemorrhagic cystitis",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Chlorambucil",
"       </td>",
"       <td>",
"        Rare cases of sterile cystitis",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Cabazitaxel",
"       </td>",
"       <td>",
"        Hemorrhagic cystitis in 17 percent; severe (grade 3 or 4) in 2 to 3 percent",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
