var title_f35_1_35868="Clinical criteria for Staphylococcal toxic shock syndrome";
var content_f35_1_35868=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F54778&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F54778&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Clinical criteria for Staphylococcal toxic shock syndrome (issued by Centers for Disease Control)",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Fever",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        T &gt;38.9&deg;C (102.0&deg;F)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Hypotension",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Systolic blood pressure &le;90 mmHg for adults or less than fifth percentile by age for children &lt;16 years of age; orthostatic drop",
"in diastolic blood pressure &ge;15 mmHg",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Orthostatic syncope or dizziness",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Rash",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Diffuse macular erythroderma",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Desquamation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        1 to 2 weeks after onset of illness, particularly",
"involving palms and soles",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Multisystem",
"involvement (3 or more of the following organ systems)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         GI:",
"        </strong>",
"        Vomiting or diarrhea",
"at onset of illness",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Muscular:",
"        </strong>",
"        Severe myalgia",
"or CPK elevation &gt;2 times the normal upper limit",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Mucous membranes:",
"        </strong>",
"        Vaginal,",
"oropharyngeal, or conjunctival hyperemia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Renal:",
"        </strong>",
"        BUN or serum",
"creatinine &gt;2 times the normal upper limit, or pyuria (&gt;5",
"WBC/hpf)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Hepatic:",
"        </strong>",
"        Bilirubin or",
"transaminases &gt;2 times the normal upper limit",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Hematologic:",
"        </strong>",
"        Platelets",
"&lt;100,000/&micro;L",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Central nervous system:",
"        </strong>",
"        Disorientation or alterations in consciousness without focal neurologic",
"signs in the absence of fever and hypotension",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Negative results on",
"the following tests, if obtained",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Blood, throat, or cerebrospinal fluid cultures for another pathogen (blood",
"cultures may be positive for Staphylococcus aureus)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Serologic tests for Rocky Mountain spotted fever,",
"leptospirosis, or measles",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    CPK, creatine phosphokinase; BUN, blood urea nitrogen.",
"    <div class=\"footnotes\">",
"     *Criteria for a confirmed case include a patient with fever &gt;38.9&deg;C, hypotension, diffuse erythroderm, desquamation (unless the patient dies before desquammation can occur), and involvement of at least three organ systems. A probable case, is a patient who is missing one of the characteristics of the confirmed case definition.",
"    </div>",
"    <div class=\"reference\">",
"     Data from CDC: Case definitions for public health surveillance MMWR Morb Mortal Wkly Rep 1990; 39(RR-13):1. CDC: Case definitions for infectious conditions under public health surveillance. MMWR Morb Mortal Wkly Rep 1997; 46(RR-10):39.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
